Celine Dion suffers from a severe illness, which has been documented in a very brave video posted on social media.
This illness prevents her from singing, because it stiffens her body and also her vocal cords, which have to be free to vibrate in order to sound that extraordinary way.
So I'm sorry to have to say this, but the Paris performance is probably played back, for more reasons:
1. In a live recording, especially on a rainy day and above the Eiffel Tower, wind or rain noises, or more simply the singer's breathing, would necessarily enter the microphone, but here everything is perfectly muffled as in a recording studio;
2. It‚Äôs almost impossible for an artist who is absent from concerts for years and suffers from such an illness to return with a voice that is practically identical and perfect as before;
3. The shots are never fixed on her; only a few moments frame her closely and directly, then the camera cleverly pans away;
4. In the few moments of close-up shots, especially at the beginning, it is noticeable that some of the singing attacks are a fraction late or that there is no real intensity of Voice‚Äôs emission, so it is sad to say but it is probably a play back. Obviously very well done and rehearsed, also considering the calibre of the artist, but a play back probably it remains.
To Celibe Dion all my admiration for her incredible career, her extraordinary and unique voice and her courage in facing illness, but in this case it is right to point out that something is not right and not just get caught up in the emotion of the moment.
